import { useState } from 'react'
import { StyledCollapsible } from './styled.collapisble'

export const Collapsible = ({ label, children }) => {
	const [isOpen, setIsOpen] = useState(false)
	console.log(label)

	return (
		<div className>
			<button onClick={() => setIsOpen(!isOpen)}>
				{isOpen && { children }}
				{label}
			</button>
		</div>
	)
}
